Array.from(document.head.querySelectorAll("link")).filter(a=>a.getAttribute("rel")=="apple-touch-icon" && !a.hasAttribute("sizes") && !a.getAttribute("href").split("/").at(-1).startsWith("favicon")).forEach(a=>a.remove());
</script>
